import React, { Component } from 'react';
import './APP.css';

class Subject extends Component {
  render() { //컴퍼넌트는 반드시 하나의 최상위 태그로 시작해야함 
    return (
      <header>
        <h1>web</h1>
    </header>
    );
  }
}

class App extends Component {
  render() {
    return (
      <div className="App">
        <Subject></Subject>
      </div>
    );
  }
}
export default App;
